var apiServices=function(){const apiUrl="/api",request=axios.create({});let config_headers={"Content-Type":"application/json",Accept:"application/json","X-CSRF-TOKEN":document.querySelector('[name="csrf-token"]').content};async function processRequest(method,url,payload,headers=config_headers){let endpoint="/api"+url,process="get"===method.toLowerCase()?request.get(endpoint,{headers:headers}):request[method](endpoint,payload,{headers:headers});return await process.then(response=>response.data.errors&&("object"!=typeof response.data.errors||Object.keys(response.data.errors).length)?(console.error(`API Error: ${url}`,response.data.errors),{state:!1,data:response.data}):{state:!0,data:response.data}).catch(error=>(error.response.data&&error.response.data.errors&&console.error(`API Error: ${url}`,error.response.data.errors),{state:!1,data:error.response.data}))}return{processRequest:processRequest}}();